const { validateAndNormalizeUrl } = require('./lib/url-utils.ts');

const testUrls = [
  'https://www.dr.dk/',
  'dr.dk',
  'www.dr.dk',
  'example.com',
  'https://news.ycombinator.com'
];

testUrls.forEach(url => {
  const result = validateAndNormalizeUrl(url);
